package com.fr.bi.cal.analyze.cal.utils;import com.fr.bi.field.target.target.BISummaryTarget;import com.fr.bi.cal.analyze.session.BISession;import com.fr.bi.stable.report.result.TargetCalculator;import java.util.HashMap;import java.util.Map;/** * Created by Hiram on 2015/1/5. */public class CommonUtils {    public static Map<String, TargetCalculator> getStringTargetGettingKeyMap(BISummaryTarget[] allSumTarget, BISession sessionIDInfo) {        Map<String, TargetCalculator> targetsMap = new HashMap<String, TargetCalculator>();        for (int i = 0, len = allSumTarget.length; i < len; i++) {            BISummaryTarget target = allSumTarget[i];            targetsMap.put(target.getValue(), target.createSummaryCalculator());        }        return targetsMap;    }}